import React from "react";
import Link from "next/link";
import User from "../../components/user/user";

const authIndexPage = props => {
  return (
    <div>
      <h1>Auth</h1>
      <User name="Cian" age={27} />
      <p>
        <Link href="/">
          <a>Main</a>
        </Link>
      </p>
    </div>
  );
};

export default authIndexPage;
